import React, { useState, useEffect } from "react";
import ProgressBar from "../Shipping/shipping";
import { Link } from "react-router-dom";

function Fetch() {
  const [data, setData] = useState([]);
  const [selectedAwb, setSelectedAwb] = useState("");

  useEffect(() => {
    const fetchData = () => {
      fetch("http://172.22.81.182:8080/rfid/getall")
        .then((response) => response.json())
        .then((actualData) => {
          console.log(actualData);
          setData(actualData);
        })
        .catch((err) => {
          console.log(err.message);
        });
    };

    fetchData();
  }, []);

  const handleTrackClick = (awb) => {
    setSelectedAwb(awb);
  };

  return (
    <div>
      {data.map((item, index) => (
        <div key={index}>
          {/* ... other code ... */}
          <td>
            <Link to={`/progress/${item.awb}`}>
              <button
                className="btn btn-neutral"
                onClick={() => handleTrackClick(item.awb)}
              >
                Track
              </button>
            </Link>
          </td>
        </div>
      ))}
      {selectedAwb && <ProgressBar trackingNumber={selectedAwb} data={data} />}
    </div>
  );
}

export default Fetch;
